<!DOCTYPE html>
<html lang="hu">
<head>
    <!-- https://aistudio.google.com/prompts/1Oar0VOEB_5x0HbCObleGlW3YDI39V1yM -->
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Phenom World: 3D Topográfia (Base64 Beágyazva)</title>
    <style>
        body { margin: 0; overflow: hidden; background-color: #050505; font-family: 'Courier New', Courier, monospace; }
        
        #ui-layer {
            position: absolute;
            top: 20px; left: 20px;
            width: 320px;
            background: rgba(10, 15, 20, 0.9);
            border: 1px solid #00ffaa;
            color: #00ffaa;
            padding: 15px;
            border-radius: 4px;
            box-shadow: 0 0 20px rgba(0, 255, 170, 0.15);
            pointer-events: auto;
            z-index: 10;
            backdrop-filter: blur(4px);
        }

        #calibration-panel {
            display: none;
            position: absolute;
            top: 20px; right: 20px;
            width: 250px;
            background: rgba(20, 10, 10, 0.9);
            border: 1px solid #ffaa00;
            color: #ffaa00;
            padding: 15px;
            border-radius: 4px;
            z-index: 10;
        }

        h1 { font-size: 16px; margin: 0 0 10px 0; border-bottom: 1px dashed currentColor; padding-bottom: 5px; }
        
        .legend-row { display: flex; align-items: center; margin-bottom: 6px; font-size: 11px; }
        .dot { width: 8px; height: 8px; margin-right: 10px; border: 1px solid #fff; }

        input[type=range] { width: 100%; cursor: pointer; margin-bottom: 5px; }
        label { font-size: 10px; display: flex; justify-content: space-between; margin-top: 5px;}

        #tooltip {
            position: absolute;
            display: none;
            background: rgba(0, 0, 0, 0.95);
            border: 1px solid #fff;
            color: #fff;
            padding: 12px;
            font-size: 12px;
            pointer-events: none;
            z-index: 200;
            max-width: 260px;
            box-shadow: 0 0 10px rgba(0,255,170,0.3);
        }

        #loading-overlay {
            position: absolute; top:0; left:0; width:100%; height:100%;
            background: #000; color: #00ffaa;
            display: flex; justify-content: center; align-items: center;
            z-index: 999; pointer-events: none;
            transition: opacity 1s;
        }
    </style>
    
    <script src="https://cdnjs.cloudflare.com/ajax/libs/three.js/r128/three.min.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/three@0.128.0/examples/js/controls/OrbitControls.js"></script>
</head>
<body>

    <div id="loading-overlay">
        <div>
            <h1>RENDSZER INDÍTÁSA...</h1>
            <p>Textúra kibontása a memóriából...</p>
        </div>
    </div>

    <div id="ui-layer">
        <h1>CONST // DÉLI SARK</h1>
        <div class="legend-row"><div class="dot" style="background: #00ffff;"></div>Nelumbra (Lara)</div>
        <div class="legend-row"><div class="dot" style="background: #ffaa00;"></div>Malapert (Vinh)</div>
        <div class="legend-row"><div class="dot" style="background: #ff00ff;"></div>de Gerlache (Sara)</div>
        <div class="legend-row"><div class="dot" style="background: #00ff00;"></div>Csodák Csúcsa (Carter)</div>
        <div class="legend-row"><div class="dot" style="background: #ff3333;"></div>ILRS (Kína/Orosz)</div>
        <div class="legend-row"><div class="dot" style="background: #ffffff;"></div>N-12 (Találkozás)</div>
        
        <div style="display: none; border-top: 1px dashed #004433; margin-top: 10px; padding-top: 5px;">
            <label style="color:#fff;">DOMBORZAT ERŐSSÉGE <span id="disp-val">0.5</span></label>
            <input type="range" id="displacementRange" min="0" max="15" step="0.1" value="0.5">
        </div>
    </div>

    <div id="calibration-panel">
        <h1>KALIBRÁCIÓ (RÖGZÍTETT)</h1>
        
        <label>Nagyítás (Skála) <span id="val-scale"></span></label>
        <input type="range" id="calScale" min="0.1" max="5.0" step="0.01" value="2.32">

        <label>Forgatás (Fok) <span id="val-rot">269</span></label>
        <input type="range" id="calRot" min="0" max="360" step="1" value="269">

        <label>Eltolás X <span id="val-x"></span></label>
        <input type="range" id="calX" min="-50" max="50" step="0.1" value="-7.5">

        <label>Eltolás Z <span id="val-z">7.1</span></label>
        <input type="range" id="calZ" min="-50" max="50" step="0.1" value="7.1">
    </div>
    <div id="tooltip"></div>

    // --- THREE.JS SETUP ---
    const scene = new THREE.Scene();
    scene.background = new THREE.Color(0x000000);

    const camera = new THREE.PerspectiveCamera(45, window.innerWidth / window.innerHeight, 0.1, 1000);
    camera.position.set(0, 50, 70); 
    camera.lookAt(0, 0, 0);

    const renderer = new THREE.WebGLRenderer({ antialias: true });
    renderer.setSize(window.innerWidth, window.innerHeight);
    renderer.shadowMap.enabled = true;
    document.body.appendChild(renderer.domElement);

    const planeSize = 100;

    const material = new THREE.MeshStandardMaterial({ 
        color: 0x333333, 
        side: THREE.DoubleSide,
        wireframe: true 
    });

    const mapPlane = new THREE.Mesh(geometry, material);
    mapPlane.rotation.x = -Math.PI / 2; 
    mapPlane.receiveShadow = true;
    mapPlane.castShadow = true;
    scene.add(mapPlane);

    // Ha van Base64 kód, betöltjük
    if (MOON_BASE64.length > 50) {
        const image = new Image();
        image.src = MOON_BASE64;
        image.onload = function() {
            const texture = new THREE.Texture(image);
            texture.needsUpdate = true;

            const newMaterial = new THREE.MeshStandardMaterial({
                map: texture,
                displacementMap: texture, 
                displacementScale: 1.0,   
                roughness: 0.6,
                side: THREE.DoubleSide
            });
            
            mapPlane.material = newMaterial;
            
            // UI frissítés
            document.getElementById('loading-overlay').style.opacity = 0;
            setTimeout(() => {
                document.getElementById('loading-overlay').style.display = 'none';
            }, 1000);
        };
    } else {

    // --- 3D BÁZIS GENERÁTOR ---
    function createBaseModel(type, colorHex) {
        const baseGroup = new THREE.Group();
        const material = new THREE.MeshPhongMaterial({ 
            color: colorHex, 
            emissive: colorHex,
            emissiveIntensity: 0.3,
            shininess: 30,
            flatShading: true
        });
        const wireMat = new THREE.MeshBasicMaterial({ color: 0xffffff, wireframe: true, transparent: true, opacity: 0.25 });

        switch (type) {
            case 'nelumbra': {
                const dome = new THREE.Mesh(new THREE.IcosahedronGeometry(3, 1), material);
                dome.position.y = 1.5; baseGroup.add(dome);
                const ring = new THREE.Mesh(new THREE.TorusGeometry(5, 0.4, 8, 16), material);
                ring.rotation.x = Math.PI / 2; ring.position.y = 0.5; baseGroup.add(ring);
                for(let i=0;i<3;i++){ const pod = new THREE.Mesh(new THREE.CylinderGeometry(1,1.5,2,6), material); const angle=(i/3)*Math.PI*2; pod.position.set(Math.cos(angle)*6,1,Math.sin(angle)*6); baseGroup.add(pod); }
            } break;
            case 'malapert': {
                const tower = new THREE.Mesh(new THREE.CylinderGeometry(0.5,1.5,10,4), material); tower.position.y=5; baseGroup.add(tower);
                const baseBlock = new THREE.Mesh(new THREE.BoxGeometry(4,2,4), material); baseBlock.position.y=1; baseGroup.add(baseBlock);
                const antennaGeo = new THREE.CylinderGeometry(0.1,0.1,4);
                const ant1 = new THREE.Mesh(antennaGeo, material); ant1.position.set(1,9,1); ant1.rotation.z=0.2; baseGroup.add(ant1);
            } break;
            case 'degerlache': {
                const bioDome = new THREE.Mesh(new THREE.SphereGeometry(2.5,16,16), material); bioDome.scale.y=0.6; bioDome.position.y=1.5; baseGroup.add(bioDome);
                const shield1 = new THREE.Mesh(new THREE.TorusGeometry(3,0.2,8,24,Math.PI), material); shield1.rotation.x=-Math.PI/2; shield1.position.y=1; baseGroup.add(shield1);
                const shield2 = new THREE.Mesh(new THREE.TorusGeometry(3,0.2,8,24,Math.PI), material); shield2.rotation.x=-Math.PI/2; shield2.rotation.z=Math.PI; shield2.position.y=2; baseGroup.add(shield2);
            } break;
            case 'observatory': {
                const obsBase = new THREE.Mesh(new THREE.CylinderGeometry(1.5,1.5,3,8), material); obsBase.position.y=1.5; baseGroup.add(obsBase);
                const obsDome = new THREE.Mesh(new THREE.SphereGeometry(2,16,16,0,Math.PI*2,0,Math.PI/2), material); obsDome.position.y=3; baseGroup.add(obsDome);
                const telescope = new THREE.Mesh(new THREE.CylinderGeometry(0.5,0.5,4), material); telescope.rotation.x=Math.PI/4; telescope.position.set(0,4,1.5); baseGroup.add(telescope);
            } break;
            case 'ilrs': {
                const pyramid = new THREE.Mesh(new THREE.ConeGeometry(3,5,4), material); pyramid.position.y=2.5; baseGroup.add(pyramid);
                const tank1 = new THREE.Mesh(new THREE.CylinderGeometry(1,1,3,8), material); tank1.position.set(3,1.5,0); baseGroup.add(tank1);
                const tank2 = new THREE.Mesh(new THREE.CylinderGeometry(1,1,3,8), material); tank2.position.set(-2,1.5,2); baseGroup.add(tank2);
            } break;
            case 'n12': {
                const artifact = new THREE.Mesh(new THREE.OctahedronGeometry(1.5), material); artifact.position.y=4; baseGroup.add(artifact);
                const frag1 = new THREE.Mesh(new THREE.OctahedronGeometry(0.5), material); frag1.position.set(1.5,3,0); baseGroup.add(frag1);
            } break;
            default: {
                const defaultPin = new THREE.Mesh(new THREE.CylinderGeometry(0.0,0.3,5,8), new THREE.MeshBasicMaterial({color: colorHex})); defaultPin.position.y=2.5; baseGroup.add(defaultPin);
            }
        }

        baseGroup.scale.set(0.8,0.8,0.8);
        baseGroup.traverse((child)=>{ if(child.isMesh){ child.castShadow=true; child.receiveShadow=true; const wire = new THREE.LineSegments(new THREE.WireframeGeometry(child.geometry), wireMat); child.add(wire); }});
        return baseGroup;
    }
    const markersGroup = new THREE.Group();
    scene.add(markersGroup);
    const markers = [];

    // --- ANIMÁCIÓS ADATOK ---
    const baseAnimations = new Map();

    locations.forEach(loc => {
        const baseModel = createBaseModel(loc.type || '', loc.colorHex);
        const pickSphere = new THREE.Mesh(new THREE.SphereGeometry(1.2, 8, 8), new THREE.MeshBasicMaterial({ visible: false }));
        pickSphere.userData = loc;

        const label = makeTextSprite(loc.name, { fontsize: 24, textColor: loc.colorHex });
        label.position.y = 6;

        const group = new THREE.Group();
        group.add(baseModel);
        group.add(pickSphere);
        group.add(label);

        group.userData = { lat: loc.lat, lon: loc.lon, locationName: loc.name };
        markersGroup.add(group);
        markers.push(pickSphere);

        // Animációs állapot tárolás - mindegyik bázisnak saját animációja
        baseAnimations.set(group, {
            isAnimating: false,
            progress: 0,
            duration: 6,
            baseModel: baseModel,
            originalY: 0,
            maxHeight: 8,
            rotationSpeed: Math.PI * 2
        });
    });

    // --- LOGIKA ---
    function updatePositions() {
        const scale = parseFloat(document.getElementById('calScale').value);
        const rotationDeg = parseFloat(document.getElementById('calRot').value);
        const offsetX = parseFloat(document.getElementById('calX').value);
        const offsetZ = parseFloat(document.getElementById('calZ').value);

        document.getElementById('val-scale').innerText = scale.toFixed(2);
        document.getElementById('val-rot').innerText = rotationDeg;
        document.getElementById('val-x').innerText = offsetX.toFixed(1);
        document.getElementById('val-z').innerText = offsetZ.toFixed(1);

        const rotationRad = rotationDeg * (Math.PI / 180);

        markersGroup.children.forEach(group => {
            const lat = group.userData.lat;
            const lon = group.userData.lon;

            const r = (90 - Math.abs(lat)) * scale * 5; 
            const theta = (lon * (Math.PI / 180)) + rotationRad;

            group.position.x = (r * Math.cos(theta)) + offsetX;
            group.position.z = (r * Math.sin(theta)) + offsetZ;
        });
    }

    // --- DOMBORZAT INPUT ---
    const dispInput = document.getElementById('displacementRange');
    const dispVal = document.getElementById('disp-val');

    dispInput.addEventListener('input', (e) => {
        const val = parseFloat(e.target.value);
        if(mapPlane.material.displacementScale !== undefined) {
            mapPlane.material.displacementScale = val;
            dispVal.innerText = val.toFixed(1);
        }
    });

    // --- SPRITE ---
    function makeTextSprite(message, opts) {
        const fontsize = 24;
        const canvas = document.createElement('canvas');
        const context = canvas.getContext('2d');
        context.font = "Bold " + fontsize + "px Courier New";
        const metrics = context.measureText(message);
        canvas.width = metrics.width + 10;
        canvas.height = fontsize + 10;
        
        context.font = "Bold " + fontsize + "px Courier New";
        context.fillStyle = "rgba(0,0,0,0.7)";
        context.fillRect(0,0, canvas.width, canvas.height);
        
        context.fillStyle = opts.textColor || "#ffffff";
        context.fillText(message, 5, fontsize);

        const texture = new THREE.Texture(canvas);
        texture.needsUpdate = true;
        const spriteMat = new THREE.SpriteMaterial({ map: texture });
        const sprite = new THREE.Sprite(spriteMat);
        
        const ratio = canvas.width / canvas.height;
        sprite.scale.set(2 * ratio, 2, 1);
        return sprite;
    }

    // --- EASING FUNKCIÓ (MOTION TWEEN HATÁS) ---
    function easeInOutQuad(t) {
        return t < 0.5 ? 2 * t * t : -1 + (4 - 2 * t) * t;
    }

    // --- INTERAKCIÓ ---
    const raycaster = new THREE.Raycaster();
    const mouse = new THREE.Vector2();
    const tooltip = document.getElementById('tooltip');

    window.addEventListener('mousemove', (e) => {
        mouse.x = (e.clientX / window.innerWidth) * 2 - 1;
        mouse.y = -(e.clientY / window.innerHeight) * 2 + 1;
        tooltip.style.left = e.clientX + 15 + 'px';
        tooltip.style.top = e.clientY + 15 + 'px';
    });

    document.querySelectorAll('#calibration-panel input').forEach(input => {
        input.addEventListener('input', updatePositions);
    });

    function animate() {
        requestAnimationFrame(animate);
        controls.update();

        raycaster.setFromCamera(mouse, camera);
        const intersects = raycaster.intersectObjects(markers);

        // Animációk frissítése - mindegyik holdbase egyénileg
        baseAnimations.forEach((animData, group) => {
            if (animData.isAnimating) {
                animData.progress += 1 / (animData.duration * 60);
                
                if (animData.progress >= 1) {
                    animData.progress = 1;
                    animData.isAnimating = false;
                }

                const t = animData.progress;
                const easedT = easeInOutQuad(t);

                // ANIMÁCIÓ LOGIKA: Felemelkedés, forgatás, visszasüllyedés
                let heightOffset = 0;
                let rotation = 0;
                let scaleMultiplier = 1;

                if (t < 0.5) {
                    // Felemelkedés (0-0.5) - felfelé mozgás + forgatás
                    const riseT = easeInOutQuad(t * 2);
                    heightOffset = riseT * animData.maxHeight;
                    rotation = (t * 2) * animData.rotationSpeed;
                    // Méretváltozás: 1.0 -> 1.15 -> 1.0
                    scaleMultiplier = 1 + riseT * 0.15;
                } else {
                    // Visszasüllyedés (0.5-1) - lefelé mozgás + forgatás befejezése
                    const fallT = easeInOutQuad((t - 0.5) * 2);
                    heightOffset = (1 - fallT) * animData.maxHeight;
                    rotation = animData.rotationSpeed;
                    scaleMultiplier = 1 + (1 - fallT) * 0.15;
                }

                animData.baseModel.position.y = animData.originalY + heightOffset;
                animData.baseModel.rotation.y = rotation;
                animData.baseModel.scale.set(scaleMultiplier, scaleMultiplier, scaleMultiplier);
            }
        });

        if (intersects.length > 0) {
            const targetSphere = intersects[0].object;
            const targetGroup = targetSphere.parent;
            const data = targetSphere.userData;

            // Hover animáció aktiválása
            if (baseAnimations.has(targetGroup)) {
                const anim = baseAnimations.get(targetGroup);
                if (!anim.isAnimating) {
                    anim.isAnimating = true;
                    anim.progress = 0;
                }
            }

            tooltip.style.display = 'block';
            tooltip.style.borderLeft = `3px solid ${data.colorHex}`;
            tooltip.innerHTML = `
                <strong style="color:${data.colorHex}">${data.name}</strong><br>
                <span style="font-size:10px; color:#ccc">${data.role} // ${data.char}</span><br>
                <i style="color:#888">${data.desc}</i>
            `;
            document.body.style.cursor = 'pointer';
        } else {
            tooltip.style.display = 'none';
            document.body.style.cursor = 'default';
        }

        renderer.render(scene, camera);
    }

    // Inicializálás
    updatePositions();
    animate();

    window.addEventListener('resize', () => {
        camera.aspect = window.innerWidth / window.innerHeight;
        camera.updateProjectionMatrix();
        renderer.setSize(window.innerWidth, window.innerHeight);
    });

</script>
</body>
</html>
